import React from 'react';

function ResumeAtsScorePage() {
  const missingTechnicalSkills = {
    "React": "https://www.google.com/search?q=React",
    "Node.js": "https://www.google.com/search?q=Node.js",
    "MongoDB": "https://www.google.com/search?q=MongoDB"
  };

  const missingSoftSkills = [
    "Communication",
    "Teamwork",
    "Problem-solving",
    "Adaptability"
  ];

  const resumeScore = 75; // Sample resume score

  return (
    <div>
      <center>
        <h1>Resume ATS Score</h1>
        <h2>Your ATS Score: {resumeScore}</h2>
      </center>
      {Object.keys(missingTechnicalSkills).length > 0 && (
        <div>
          <h2>Missing Technical Skills:</h2>
          <ul>
            {Object.keys(missingTechnicalSkills).map((skill, index) => (
              <li key={index}>
                <a href={missingTechnicalSkills[skill]} target="_blank" rel="noopener noreferrer">{skill}</a>
              </li>
            ))}
          </ul>
        </div>
      )}
      {missingSoftSkills.length > 0 && (
        <div>
          <h2>Missing Soft Skills:</h2>
          <ul>
            {missingSoftSkills.map((skill, index) => (
              <li key={index}>{skill}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default ResumeAtsScorePage;
